import { SharedCard } from './SharedCard';
import Illustration_17 from '../../../assets/images/js/Illustration_17';

export const CardTherapyProgress = () => {
  const title = `Tremor reduction`;
  const description = `You've had an average 52% improvement`;
  const image = <Illustration_17 />;
  const navLink = 'InsightsTremor';
  const nextButton = true;

  return (
    <>
      <SharedCard
        image={image}
        title={title}
        description={description}
        navLink={navLink}
        nextButton={nextButton}
      />
    </>
  );
};
